package com.dongqiudi.dc.etl.model

import java.io.{ByteArrayInputStream, ByteArrayOutputStream, IOException}
import java.net.URLDecoder
import java.util
import java.util.zip.GZIPInputStream

import com.dongqiudi.dc.util.LogConvertUtil
import com.fasterxml.jackson.core.JsonParser.Feature
import com.fasterxml.jackson.databind.ObjectMapper
import org.apache.commons.codec.binary.Base64
import org.apache.spark.Logging
import org.apache.spark.sql.Row
import org.apache.spark.sql.types.{MapType, StringType, StructField, StructType}

import scala.util.matching.Regex

/**
  *
  * Created by matrix on 18/2/7.
  */
object EventsNginxSensor extends Serializable with Logging {
  // 日志格式示例

  val struct = StructType(Array(
    StructField("uuid", StringType),
    StructField("timestamp", StringType),
    StructField("event", StringType),
    StructField("remote_ip", StringType),
    StructField("properties", MapType(StringType, StringType)),
    StructField("day", StringType),
    StructField("hour", StringType)
  ))

  def parseLog(line: String): Array[Row] = {
    try {
      val array = line.replace("\"", "").split("\\+\\+_")
      if (array.length != 13) {
        Array(Row(0))
      }
      var timeStr = array(0).substring(0, array(0).length - 1)
      if (timeStr.length != (25)) {
        val pattern = new Regex("[0-9]{4}-[0-9]{2}-[0-9]{2}T[0-9]{2}:[0-9]{2}:[0-9]{2}\\+[0-9]{2}:[0-9]{2}")
        timeStr = pattern.findAllIn(timeStr).mkString(",")
      }
      val remoteIP = array(1).substring(1, array(1).length - 1)
      val dataList = array(7)
      val sdk = array(8)
      // val userAgent = array(8).substring(1, array(8).length - 1)
      // val project = array(9)

      val day = LogConvertUtil.getDay(timeStr)
      val hour = LogConvertUtil.getHour(timeStr)

      val profix = "data_list="
      val idx = dataList.indexOf(profix)
      if (idx < 0) {
        Array(Row(0))
      }
      var data = dataList.substring(idx + 10)
      data = URLDecoder.decode(data, "UTF-8")
      var bytes = Base64.decodeBase64(data)
      if (dataList.contains("gzip=1") || sdk.contains("iOS")) {
        bytes = uncompress(bytes)
      }

      val objectMapper: ObjectMapper = new ObjectMapper
      // 允许出现特殊字符和转义符
      objectMapper.configure(Feature.ALLOW_UNQUOTED_CONTROL_CHARS, true)
      objectMapper.configure(Feature.ALLOW_UNQUOTED_FIELD_NAMES, true)

      val list = objectMapper.readValue(bytes, classOf[util.ArrayList[util.HashMap[String, AnyRef]]])
      val result = new Array[Row](list.size())
      for(i <- 0 until list.size()) {
        val time = list.get(i).get("time").asInstanceOf[Long]
        val event = list.get(i).get("event").asInstanceOf[String]
        val uuid = list.get(i).get("distinct_id").asInstanceOf[String]
        val properties = list.get(i).get("properties").asInstanceOf[util.HashMap[String, AnyRef]]

        if (time == 0 || event == null || uuid == null || properties == null) {
          result(i) = Row(0)
        } else {
          import scala.collection.JavaConversions._
          for (entry <- properties.entrySet) {
            val key = entry.getKey
            val value = entry.getValue.toString
            properties.put(key, value)
          }

          result(i) = Row(
            uuid,
            time.toString,
            event,
            remoteIP,
            properties,
            day,
            hour
          )
        }
      }
      result
    } catch {
      case e: Exception =>
        logError("ParseError log[" + line + "] msg[" + e.toString + "]")
        Array(Row(0))
    }
  }

  private def uncompress(bytes: Array[Byte]): Array[Byte] = {
    if ((bytes == null) || (bytes.length == 0)) return null
    val out = new ByteArrayOutputStream
    val in = new ByteArrayInputStream(bytes)
    try {
      val ungzip = new GZIPInputStream(in)
      val buffer = new Array[Byte](256)
      var n = 0
      while (n >= 0) {
        n = ungzip.read(buffer)
        if (n >= 0) {
          out.write(buffer, 0, n)
        }
      }
    } catch {
      case e: IOException =>
        e.printStackTrace()
    }
    out.toByteArray
  }

  def main(args: Array[String]): Unit = {
